import React from "react";

const categories = [
  {
    title: "Skin Care",
    image: "Hx8fHw%3D&auto=format&fit=crop&q=60&w=60",
    description: "Natural ways to keep your skin glowing and healthy.",
  },
  {
    title: "Beauty Care",
    image: "https://images.unsplash.com/photo-1522336572468-97b06e8ef143",
    description: "Enhance your beauty with herbal and organic care tips.",
  },
  {
    title: "Health Care",
    image: "https://images.unsplash.com/photo-1576675784449-9c37b99a34cd",
    description: "Improve your overall health through natural practices.",
  },
  {
    title: "Home Remedies",
    image: "https://images.unsplash.com/photo-1505577058444-a3dab90d4253",
    description: "Simple remedies for everyday ailments using household ingredients.",
  },
];

export default function Dashboard() {
  return (
    <div className="dashboard-container">
      <header className="dashboard-header">
        <h1>ðŸŒ¿ Natureâ€™s Cure</h1>
        <p>Explore natural ways to heal and rejuvenate your body and soul.</p>
      </header>

      <div className="card-grid">
        {categories.map((item, index) => (
          <div key={index} className="card">
            <img src={item.image} alt={item.title} className="card-image" />
            <h2>{item.title}</h2>
            <p>{item.description}</p>
            <button className="explore-btn">Explore</button>
          </div>
        ))}
      </div>
    </div>
  );
}
